IF OBJECT_ID('dbo.proc_transform_358', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_358;
GO
CREATE PROCEDURE dbo.proc_transform_358
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_358
    SET payload = LEFT(payload, 1000) + N'|V4-358|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_358;
END
GO
IF OBJECT_ID('dbo.audit_v4_358', 'U') IS NULL
